function codesite() {
var defaultBounds = new google.maps.LatLngBounds(
    new google.maps.LatLng(33.635631,-84.558592),
    new google.maps.LatLng(33.885665,-84.288311)
  ); 
for (var i = 0; i < gmarkers.length; i++) {
    gmarkers[i].setMap(null);
  } 
var request = {
      bounds: defaultBounds,
      query: document.getElementById('target').value
    };
initialService.textSearch(request, sitecallback);
}

function sitecallback(results, status,pagination) {
var defaultBounds = new google.maps.LatLngBounds(
    new google.maps.LatLng(33.635631,-84.558592),
    new google.maps.LatLng(33.885665,-84.288311)
  );
  if (status == google.maps.places.PlacesServiceStatus.OK) {
  var places = [];
  for (var i = 0; i < results.length; i++) {
    var place = results[i];
    places.push(place);
    createMarker11(results[i]);
  }   
  map.fitBounds(defaultBounds);
  if (pagination.hasNextPage) {pagination.nextPage();}
       }
  }

function createMarker11(place){
if (place.icon) {
      var image = new google.maps.MarkerImage(
                place.icon, new google.maps.Size(71, 71),
                new google.maps.Point(0, 0), new google.maps.Point(17, 34),
                new google.maps.Size(25, 25));
     } else var image = null;
    var marker=new google.maps.Marker({
        map:map,
        icon: image,
		title: place.name,
        position:place.geometry.location
    });
    gmarkers.push(marker);
}

