function applyStyle(map, layer, column) {	
        var columnStyle = COLUMN_STYLES[column];
        var styles = [];
		styles.push({ 
			polygonOptions: {			
    fillColor: "#DEAE29",
	strokeOpacity:0.5,
	strokeWeight:0.5,
    fillOpacity: 0.3
  }
  });
  
        for (var i in columnStyle) {
          var style = columnStyle[i];
          styles.push({
            where:condition(column, style.min, style.max),	
            polygonOptions: {
              fillColor: style.color,
              fillOpacity: style.opacity ? style.opacity : 0.8,
			  strokeOpacity:0,
	strokeWeight:0
            }
          });		   
        }      
        layer.set('styles', styles);
      }
	  
function condition(columnName, low, high) {
        var whereClause = [];		
		var status = document.getElementById('status').value;
		if (whereClause == []) {if (status) {
		  whereClause.push("'");
        whereClause.push(SECstatus);		
        whereClause.push("' = ");
        whereClause.push(status);
        whereClause.push(" AND '");
        }}else {if (status) {
          whereClause.push("  'SECstatus' = '" + status + "' AND");
        }}
		
		var ttgg = document.getElementById('district').value;
		if (ttgg==''){
		if (whereClause == []) {if (ttgg) {
		whereClause.push("'");
        whereClause.push(NPU);		
        whereClause.push("' = ");
        whereClause.push(ttgg);
        whereClause.push(" AND '");
        }}else {if (ttgg) {
          whereClause.push("  'NPU' = '" + ttgg + "' AND");
        }}
		}
		else{if (ttgg) {
        var filter = [];		
		var district = document.getElementById('district');
		if (whereClause == []) {
		for (var i=0; i<district.options.length; i++) {
		if (district.options[i].selected) {
		var storeName = district.options[i].value.replace(/'/g, '\\\'');
         filter.push("'" + storeName + "'");	
          }
        }
		if (filter.length) {
		whereClause.push("'");
        whereClause.push(NPU);		
        whereClause.push("' IN (");
        whereClause.push(filter.join(','));
        whereClause.push(") AND '");
        }}else {
		for (var i=0; i<district.options.length; i++) {
		if (district.options[i].selected) {
		var storeName = district.options[i].value.replace(/'/g, '\\\'');
         filter.push("'" + storeName + "'");	
          }
        }
		if (filter.length) {
          whereClause.push("'NPU' IN (" + filter.join(',') + ') AND');
        }}	
		}}
		
        whereClause.push("'");
        whereClause.push(columnName);		
        whereClause.push("' >= ");
        whereClause.push(low);
        whereClause.push(" AND '");
        whereClause.push(columnName);
        whereClause.push("' < ");
        whereClause.push(high);	
        return whereClause.join('');	
      }
	  	  
