                      vAxis: {title: "Neighborhood Health Index ", viewWindow: {max:"26",min:"0"}, titleTextStyle: {color: "black", fontName: "Century Gothic", fontSize: "18px"}, textStyle: {color: "#E6E7E9", fontName: "Century Gothic", fontSize: "18px"}, gridlines: {color: '#E0C975', count: 10}},
                      hAxis: {title: "Neighborhood Quality of Life Index", viewWindow: {max:"26",min:"0"},titleTextStyle: {color: "black", fontName: "Century Gothic", fontSize: "18px"}, textStyle: {color: "#E6E7E9", fontName: "Century Gothic", fontSize: "18px"}, gridlines: {color: '#E0C975', count: 10}},
